rder-summary-shipping-block -->\n\n<!-- wp:woocommerce/checkout-order-summary-taxes-block -->\n<div class=\"wp-block-woocommerce-checkout-order-summary-taxes-block\"></div>\n<!-- /wp:woocommerce/checkout-order-summary-taxes-block --></div>\n<!-- /wp:woocommerce/checkout-order-summary-block --></div>\n<!-- /wp:woocommerce/checkout-totals-block --></div>\n<!-- /wp:woocommerce/checkout -->','Checkout','','publish','closed','closed','','checkout','','','2023-12-05 21:25:08','2023-12-05 21:25:08','',0,'http://rq.global.dev.test/?page_id=11',0,'page','',0),(12,1,'2023-12-05 21:25:08','2023-12-05 21:25:08','<!-- wp:shortcode -->[woocommerce_my_account]<!-- /wp:shortcode -->','My account','','publish','closed','closed','','my-account','','','2023-12-05 21:25:08','2023-12-05 21:25:08','',0,'http://rq.global.dev.test/?page_id=12',0,'page','',0),(13,1,'2023-12-05 21:25:08','0000-00-00 00:00:00','<!-- wp:paragraph -->\n<p><b>This is a sample page.</b></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h3>Overview</h3>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Our refund and returns policy lasts 30 days. If 30 days have passed since your purchase, we canâ€™t offer you a full refund or exchange.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To be eligible for a return, your item must be unused and in the same condition that you received it. It must also be in the original packaging.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Several types of goods are exempt from being returned. Perishable goods such as food, flowers, newspapers or magazines cannot be returned. We also do not accept products that are intimate or sanitary goods, hazardous materials, or flammable liquids or gases.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Additional non-returnable items:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Gift cards</li>\n<li>Downloadable software products</li>\n<li>Some health and personal care items</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<p>To complete your return, we require a receipt or proof of purchase.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Please do not send your purchase back to the manufacturer.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>There are certain situations where only partial refunds are granted:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list -->\n<ul>\n<li>Book with obvious signs of use</li>\n<li>CD, DVD, VHS tape, software, video game, cassette tape, or vinyl record that has been opened.</li>\n<li>Any item not in its original condition, is damaged or missing parts for reasons not due to our error.</li>\n<li>Any item that is returned more than 30 days after delivery</li>\n</ul>\n<!-- /wp:list -->\n\n<!-- wp:paragraph -->\n<h2>Refunds</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Once your return is received and inspected, we will send you an email to notify you that we have received your returned item. We will also notify you of the approval or rejection of your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are approved, then your refund will be processed, and a credit will automatically be applied to your credit card or original method of payment, within a certain amount of days.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Late or missing refunds</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you havenâ€™t received a refund yet, first check your bank account again.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Then contact your credit card company, it may take some time before your refund is officially posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Next contact your bank. There is often some processing time before a refund is posted.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If youâ€™ve done all of this and you still have not received your refund yet, please contact us at {email address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<b>Sale items</b>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Only regular priced items may be refunded. Sale items cannot be refunded.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Exchanges</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>We only replace items if they are defective or damaged. If you need to exchange it for the same item, send us an email at {email address} and send your item to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Gifts</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item was marked as a gift when purchased and shipped directly to you, youâ€™ll receive a gift credit for the value of your return. Once the returned item is received, a gift certificate will be mailed to you.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If the item wasnâ€™t marked as a gift when purchased, or the gift giver had the order shipped to themselves to give to you later, we will send a refund to the gift giver and they will find out about your return.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Shipping returns</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>To return your product, you should mail your product to: {physical address}.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>You will be responsible for paying for your own shipping costs for returning your item. Shipping costs are non-refundable. If you receive a refund, the cost of return shipping will be deducted from your refund.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depending on where you live, the time it may take for your exchanged product to reach you may vary.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>If you are returning more expensive items, you may consider using a trackable shipping service or purchasing shipping insurance. We donâ€™t guarantee that we will receive your returned item.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<h2>Need help?</h2>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Contact us at {email} for questions related to refunds and returns.</p>\n<!-- /wp:paragraph -->','Refund and Returns Policy','','draft','closed','closed','','refund_returns','','','2023-12-05 21:25:08','0000-00-00 00:00:00','',0,'http://rq.global.dev.test/?page_id=13',0,'page','',0),(14,1,'2023-12-05 21:27:59','2023-12-05 21:27:59','<p>At [Company Name], our mission is clear: to provide top-tier tools and create an environment that empowers youth to transform into global conscious leaders. We believe that young people have the potential to make a significant impact on the world, and it is our goal to support them in their journey towards becoming influential change-makers.</p><h2>Why Youth Empowerment Matters</h2><p>Youth empowerment is crucial for the development of society as a whole. When young people are given the resources, skills, and opportunities to thrive, they can contribute to positive social change, economic growth, and sustainable development. By investing in their development, we are investing in the future of our communities and the world.</p><p>Empowering youth not only benefits them individually but also has a ripple effect on their families, communities, and beyond. When young people are equipped with the necessary tools and knowledge, they can become agents of change, tackling pressing global issues such as poverty, inequality, climate change, and social injustice.</p><h2>Providing Top-Tier Tools</h2><p>At [Company Name], we understand the importance of providing young people with the right tools to succeed. We offer a wide range of resources and programs designed to foster personal growth, leadership skills, and global awareness.</p><p>Our workshops and training sessions cover a variety of topics, including communication skills, critical thinking, problem-solving, and cultural competency. We believe that these skills are essential for youth to navigate the complexities of the modern world and become effective leaders.</p><p>In addition to skill-building, we also emphasize the importance of character development and ethical leadership. We encourage young people to embrace values such as empathy, integrity, and social responsibility. By instilling these qualities, we aim to cultivate a new generation of leaders who are not only successful but also compassionate and mindful of their impact on others.</p><h2>Creating a Supportive Environment</h2><p>Empowering youth goes beyond providing tools and resources; it also involves creating a supportive environment where they can thrive. At [Company Name], we strive to foster a sense of belonging and community among our participants.</p><p>Our programs offer opportunities for collaboration, mentorship, and networking. We believe that these connections are vital for young people to expand their horizons, gain new perspectives, and build lasting relationships. By creating a supportive network, we aim to empower youth with a strong foundation for personal and professional growth.</p><h2>Transforming Youth into Global Conscious Leaders</h2><p>Our ultimate goal is to transform youth into global conscious leaders who are aware of the challenges facing our world and are committed to creating positive change. We believe that by empowering young people to think critically, act ethically, and embrace diversity, we can shape a better future for all.</p><p>Through our programs, we encourage youth to become active global citizens, engaging in issues that matter to them and taking action to address them. Whether it\'s through community service, advocacy, or entrepreneurship, we support young people in finding their unique path towards making a difference.</p><p>By providing top-tier tools and creating a supportive environment, we are confident that our youth participants will emerge as global conscious leaders, equipped with the skills, knowledge, and passion to shape a better world.</p><p>Join us in our mission to empower youth and create a brighter future for all.</p>','Empowering Youth to Become Global Conscious Leaders','','publish','open','open','','empowering-youth-to-become-global-conscious-leaders-5','','','2023-12-05 21:27:59','2023-12-05 21:27:59','',0,'http://rq.global.dev.test/?p=14',0,'post','',0),(15,1,'2023-12-05 21:28:01','2023-12-05 21:28:01','<p>At [Company Name], our mission is clear: to provide top-tier tools and a nurturing space for young individuals to transform into global conscious leaders. We believe that the youth of today hold immense potential and have the power to shape the future of our world. By equipping them with the necessary skills, knowledge, and mindset, we aim to empower them to make a positive impact on society.</p><h2>Why Youth Empowerment Matters</h2><p>Youth empowerment is vital for several reasons. Firstly, young people are the future leaders, innovators, and change-makers. By investing in their personal and professional development, we are investing in the future of our communities and the world at large. Secondly, empowering youth helps to address the challenges they face, such as unemployment, poverty, discrimination, and lack of access to quality education. By providing them with the right tools and opportunities, we can help break the cycle of inequality and create a more inclusive society.</p><h2>Top-Tier Tools for Transformation</h2><p>At [Company Name], we understand that empowering youth requires more than just inspiration and motivation. It requires providing them with practical tools and resources that can enable their transformation. Here are some of the top-tier tools we offer:</p><ol>  <li><strong>Mentorship Programs:</strong> We connect young individuals with experienced mentors who can guide and support them in their personal and professional growth. Our mentors provide valuable insights, advice, and encouragement to help youth navigate their journeys.</li>  <li><strong>Leadership Training:</strong> We offer comprehensive leadership training programs that focus on developing essential skills such as communication, critical thinking, problem-solving, and decision-making. These programs also emphasize the importance of empathy, social responsibility, and ethical leadership.</li>  <li><strong>Entrepreneurship Support:</strong> We provide aspiring young entrepreneurs with the tools and resources they need to turn their ideas into successful ventures. This includes business planning, financial management, marketing strategies, and access to networks and funding opportunities.</li>  <li><strong>Global Awareness Programs:</strong> We organize educational and cultural exchange programs that expose youth to different perspectives, cultures, and global issues. These programs help broaden their horizons, foster empathy, and develop a global mindset.</li>  <li><strong>Community Engagement:</strong> We encourage youth to actively participate in community service and volunteer initiatives. By engaging in meaningful projects, they develop a sense of social responsibility and learn the importance of giving back to society.</li></ol><h2>Creating Global Conscious Leaders</h2><p>Our ultimate goal is to nurture youth into global conscious leaders who are not only successful in their chosen fields but also deeply committed to making a positive impact on the world. We believe that global conscious leaders possess the following qualities:</p><ul>  <li><strong>Ethical Decision-Making:</strong> They prioritize ethical considerations in their decision-making processes and strive to create win-win situations for all stakeholders.</li>  <li><strong>Social Responsibility:</strong> They are aware of the social, economic, and environmental challenges facing the world and take proactive steps to address them.</li>  <li><strong>Cultural Competence:</strong> They respect and appreciate diversity, and are able to work effectively with people from different backgrounds and cultures.</li>  <li><strong>Collaboration and Empathy:</strong> They value collaboration and teamwork, and are empathetic towards others, seeking to understand and address their needs and concerns.</li>  <li><strong>Vision and Innovation:</strong> They have a clear vision for the future and are willing to think outside the box to find innovative solutions to complex problems.</li></ul><p>By providing top-tier tools and a nurturing space, we are committed to supporting youth on their journey towards becoming global conscious leaders. Together, we can create a generation of empowered individuals who will shape a better future for all.</p>','Empowering Youth to Become Global Conscious Leaders','','publish','open','open','','empowering-youth-to-become-global-conscious-leaders-6','','','2023-12-05 21:28:01','2023-12-05 21:28:01','',0,'http://rq.global.dev.test/?p=15',0,'post','',0),(16,1,'2023-12-05 21:28:52','2023-12-05 21:28:52','{\"id\":16,\"field_id\":5,\"fields\":{\"0\":{\"id\":\"0\",\"type\":\"name\",\"label\":\"Name\",\"format\":\"simple\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"simple_placeholder\":\"Your Name\",\"simple_default\":\"\",\"first_placeholder\":\"\",\"first_default\":\"\",\"middle_placeholder\":\"\",\"middle_default\":\"\",\"last_placeholder\":\"\",\"last_default\":\"\",\"label_hide\":\"1\",\"css\":\"wpforms-one-half wpforms-first\"},\"3\":{\"id\":\"3\",\"type\":\"email\",\"label\":\"Email\",\"description\":\"\",\"required\":\"1\",\"size\":\"large\",\"placeholder\":\"Your Email\",\"confirmation_placeholder\":\"\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"wpforms-one-half\"},\"4\":{\"id\":\"4\",\"type\":\"text\",\"label\":\"Subject\",\"description\":\"\",\"size\":\"large\",\"placeholder\":\"Subject\",\"label_hide\":\"1\",\"default_value\":\"\",\"css\":\"\",\"input_mask\":\"\"},\"2\":{\"id\":\"2\",\"type\":\"textarea\",\"label\":\"Message\",\"description\":\"\",\"required\":\"1\",\"size\":\"medium\",\"placeholder\":\"Your Mes